    [],nt"revision_timestamp": "2016-07-27T22:22:47.342581",nt"name": "progress-report-integrated-ecological-studies-at-lisbon-bottom-unit-big-muddy-fish-and-wil",nt"isopen":
    false,nt"url": null,nt"notes": "The U.S. Geological Survey has been carrying
    out integrated ecological studies at the Lisbon Bottom Unit of the Big Muddy Fish
    and Wildlife Refuge since 1996. This report outlines progress achieved during fiscal
    year 1999. The general objective of integrated ecological research at Lisbon Bottom
    is to quantify ecological responses to dynamic habitat changes as the area reconnects
    to the river. Understanding of hydrologic pathways requires evaluations over seasonal
    to multi-annual time periods. The area of focus is the Lisbon Bottom unit and the
    contigous areas of channel and valley bottom that can be included to define a reach-scale
    corridor, approximately river mile (RM) 213 to RM 219. The project objectives are;
    1) Quantify habitat dynamics at Lisbon Bottom due to geomorphologic changes in the
    chute, channel, and flood plain, 2) Quantify habitat dynamics in the chute and channel
    resulting from hydrologic variation and related to reservoir releases, and 3) Interpret
    results to aid management and rehabilitation project design.",nt"license_title":
